css:
@namespace url("http://www.w3.org/1999/xhtml");

/* to make it appear in the 'google.com' sub-category of userstyles.org */
@-moz-document domain("google.com") { }


@-moz-document url-prefix("http://www.google"),
               url-prefix("https://www.google") {


/***********************************************/
/* GENERAL STYLES ******************************/

#calcontent * {
  font-family: "Segoe UI" !important;
}
#calcontent div.t1,
#calcontent div.t2,
#calcontent div[style*="height: 2px"] {
  display: none !important;
}
#calcontent .printborder {
  border: none !important;
}

/***********************************************/

#calcontent {
  position: fixed !important;
  top: 57px !important;
  left: 0 !important;
  right: 0 !important;
  bottom: 0 !important;
  padding: 100% 0 0 !important;
  overflow: hidden !important;
  
  font-family: "Segoe UI" !important;
  background: #6591CD repeat-x top url("data:image/png;base64,") !important;
}

/***********************************************/

#calcontent #topBar #logoparent { display: none !important; }

/***********************************************/

#calcontent #lo {
  display: none !important;
}


/***********************************************/
/* TABS ****************************************/

#calcontent #mainnav td[style*="float: right"] table {
  display: block !important;
  position: fixed !important;
  top: 60px !important;
  left: 200px !important;
  height: 27px !important;
  right: 3px !important;
  
  border: solid 1px #6593CF !important;
  background: #ADD1FF !important;
  -moz-user-select: none !important;
}
#calcontent #mainnav #printlink,
#calcontent #mainnav td[style*="float: right"] table td:not([id]) {
  display: none !important;
}

#calcontent #mainnav td[style*="float: right"] td div {
  padding: 5px 31px !important;
  border-right: solid 1px #6593CF !important;
  background: transparent repeat-x top url("data:image/png;base64,") !important;
  font: menu !important;
  color: black !important;
  cursor: pointer !important;
}
#calcontent #mainnav td[style*="float: right"] td div:hover            { background-position: 0  -26px !important; }
#calcontent #mainnav td[style*="float: right"] td div.modelinkOn       { background-position: 0  -52px !important; }
#calcontent #mainnav td[style*="float: right"] td div.modelinkOn:hover { background-position: 0  -78px !important; }
#calcontent #mainnav td[style*="float: right"] td div:focus            { background-position: 0 -104px !important; }

/***********************************************/
/* SEARCH BAR **********************************/

#calcontent form[name="search"] {
  position: fixed !important;
  top: 86px !important;
  left: 200px !important;
  right: 3px !important;
  width: auto !important;
  height: 0 !important;
  padding-top: 40px !important;
  z-index: 100 !important;
  overflow: hidden !important;
  border: 1px #6593CF !important;
  border-style: solid solid none !important;
  background: #E3EFFF !important;
  font-size: 11px !important;
}
#calcontent form[name="search"] a {
  display: none !important;
}
#calcontent form[name="search"] #maininput {
  -moz-appearance: none !important;
  position: absolute !important;
  width: 200px !important;
  top: 10px !important;
  right: 24px !important;
  padding: 2px 38px 3px 1px !important;
  border: solid 1px #6593CF !important;
}
#calcontent form[name="search"] #maininput:focus {
  outline: solid 1000px #F7BE57 !important;
}
#calcontent form[name="search"] input[type="submit"] {
  -moz-appearance: none !important;
  position: absolute !important;
  top: 11px !important;
  right: 25px !important;
  width: 17px !important;
  height: 18px !important;
  border-style: none !important;
  border-left: solid 17px transparent !important;
  padding: 0 !important;
  background: no-repeat url("data:image/png;base64,") !important;
  -moz-background-origin: border !important;
}
#calcontent form[name="search"] #maininput:focus + input[type="submit"] {
  background-position: 0px -18px !important;
}
#calcontent form[name="search"] #maininput + input[type="submit"]:hover,
#calcontent form[name="search"] #maininput + input[type="submit"]:focus {
  background-position: 0px -36px !important;
}
#calcontent form[name="search"] #maininput + input[type="submit"]:active {
  background-position: 0px -54px !important;
}

/***********************************************/

#calcontent #t1 {
  display: block !important;
  position: fixed !important;
  top: 87px !important;
  left: 201px !important;
  right: 280px !important;
  height: 40px !important;
  z-index: 110 !important;
  overflow: hidden !important;
  padding: 8px 20px 0 !important;
}
#calcontent #t1 img.navbutton {
  width: 20px !important;
  height: 20px !important;
  padding: 0 !important;
  margin: 0 8px 0 0 !important;
  vertical-align: top !important;
  background: no-repeat url("data:image/png;base64,") !important;
}
#calcontent #t1 img.navbutton.navBack           { background-position: top    left  !important; }
#calcontent #t1 img.navbutton.navBack:hover     { background-position: center left  !important; }
#calcontent #t1 img.navbutton.navForward        { background-position: top    right !important; }
#calcontent #t1 img.navbutton.navForward:hover  { background-position: center right !important; }

#calcontent #t1 h2 span {
  padding: 0 !important;
  margin: 0 0 0 8px !important;
  font-size: 20px !important;
  font-weight: normal !important;
}

/***********************************************/
/* MAIN PANEL **********************************/

#calcontent #mainbody {
  display: block !important;
}

#calcontent #mainbody .mainGrid {
  position: fixed !important;
  top: 127px !important;
  bottom: 3px !important;
  left: 200px !important;
  right: 3px !important;
  padding: 0 !important;
  height: auto !important;
  overflow: hidden !important;
  border: 1px #6593CF !important;
  border-style: none solid solid !important;
  background: #E3EFFF !important;
}

/* HEADERS *************************************/

#calcontent #headers {
  position: absolute !important;
  top: 0 !important;
  background: #E3EFFF !important;
}
#calcontent #headers #colheaders {
  height: 19px !important;
  margin-right: 0 !important;
  border-right: solid 17px #8DAED9 !important;
}
#calcontent #headers #colheaders .chead {
  border: none !important;
}
#calcontent #headers #colheaders .chead span {
  display: block !important;
  height: 17px !important;
  border: 1px #8DAED9 !important;
  border-style: solid none solid solid !important;
  color: black !important;

}


#calcontent #headers #colheaders .chead span,
#calcontent #calowner > #grid .dayOfMonth > span {
  background: #D6E2F1 repeat-x url("data:image/png;base64,") !important;
}


#calcontent #headers #colheaders .chead a {
  display: block !important;
  height: 17px !important;
  color: black !important;
  text-decoration: none !important;
}
#calcontent #headers td[style*="display: none"] + td #colheaders {
  border: none !important;
}
#calcontent #headers td[style*="display: none"] + td #colheaders .chead span {
  height: 19px !important;
  border-style: none none none solid !important;
  background: none !important;
}
#calcontent #headers td[style*="display: none"] + td #colheaders .chead:first-child span {
  border-style: none !important;
}
#calcontent #headers #allDayGrid {
  height: 50px !important;
  margin: 0 !important;
  border: none !important;
  overflow-y: scroll !important;
  background: #A5BFE1 !important;
}
#calcontent #headers #allDayGrid .allDayCell {
  min-height: 50px !important;
  border-left: 1px #5D8CC9 solid !important;
}

/***********************************************/

#calcontent #gridcontainer {
  position: absolute !important;
  top: 69px !important;
  bottom: 0 !important;
  padding: 0 !important;
  height: auto !important;
  border: 1px #6593CF !important;
  border-style: solid none none !important;
}
#calcontent #calowner > #grid {
  position: fixed !important;
  top: 143px !important;
  bottom: 4px !important;
  left: 201px !important;
  right: 4px !important;
  padding: 0 !important;
  height: auto !important;
  overflow: hidden !important;
  border: none !important;
}

#calcontent #calowner > #grid .dayOfMonth {
  height: 100% !important;
  padding: 0 !important;
  background: transparent !important;
}
#calcontent #calowner > #grid .dayOfMonth.dayNotInMonth {
  height: 100% !important;
  background: #A5BFE1 !important;
}
#calcontent #calowner > #grid .vrule,
#calcontent #calowner > #grid .hrule {
  border-color: #5D8CC9 !important;
}
#calcontent #calowner > #grid .dayOfMonth > span {
  display: block !important;
  text-align: left !important;
  text-decoration: none !important;
  color: black !important;
  font: menu !important;
  font-weight: bold !important;
  padding: 1px 3px !important;
  border: 1px #8DAED9 !important;
  border-style: solid none !important;
}

/***********************************************/

#calcontent #gridcontainer .hruleeven {
  border-top: solid 1px #A5BFE1 !important;
}
#calcontent #gridcontainer .hruleodd {
  border-top: solid 1px #E6EDF7 !important;
}
#calcontent #gridcontainer .gutter {
  border-left: solid 1px #5D8CC9 !important;
}
#calcontent #currDayTime {
  margin: 0 !important;
}

/***********************************************/

#calcontent #cover {
  position: fixed !important;
  top: 120px !important;
  top: 87px !important;
  bottom: 3px !important;
  left: 200px !important;
  right: 3px !important;
  padding: 0 !important;
  overflow-y: auto !important;
  z-index: 200 !important;
  border: 1px #6593CF !important;
  border-style: none solid solid !important;
  background: #E3EFFF !important;
}

/***********************************************/

#calcontent #lv_listview {
  position: fixed !important;
  top: 127px !important;
  bottom: 3px !important;
  left: 200px !important;
  right: 3px !important;
  padding: 0 !important;
  overflow-y: auto !important;
  z-index: 200 !important;
  border: solid 1px #6593CF !important;
  background: #E3EFFF !important;
}

/***********************************************/

#calcontent #set h2.largeSize {
  position: absolute !important;
  top: 0 !important;
  left: 0 !important;
  right: 0 !important;
  height: 44px !important;
  padding: 3px 0 0 8px !important;
  background: #FBC84F !important;
}
#calcontent #set #stabs{
  position: absolute !important;
  top: 24px !important;
  height: 17px !important;
  padding: 3px !important;
}
#calcontent #set #sbody{
  position: absolute !important;
  top: 47px !important;
  left: 0 !important;
  right: 0 !important;
  bottom: 0 !important;
  overflow-y: auto !important;
}


/***********************************************/
/* NAVIGATION SIDEBAR **************************/

#calcontent #nav {
  position: fixed !important;
  top: 264px !important;
  top: 60px !important;
  bottom: 3px !important;
  left: 3px !important;
  width: 191px !important;
  padding: 0 !important;
  overflow: auto !important;
  border: solid 1px #6593CF !important;
  border-top-width: 205px !important;
  background: #E3EFFF !important;
}

/***********************************************/

#calcontent #nav div.nb_0 {
  padding: 0 !important;
  /*min-height: 200px !important;*/
  width: auto !important;
}

/***********************************************/

#calcontent #topBar > h1.hdn:first-child {
  position: fixed !important;
  top: 61px !important;
  left: 4px !important;
  width: 174px !important;
  height: 20px !important;
  z-index: 1 !important;
  padding: 4px 8px 0 !important;
  border-left: solid 1px white !important;
  background: #E3EFFF repeat-x url("data:image/png;base64,") !important;
  color: #15428B !important;
  font-size: 16px !important;
}

/***********************************************/

#calcontent #nav div.datePickerDiv {
  position: fixed !important;
  top: 86px !important;
  left: 4px !important;
  width: 191px !important;
  height: 152px !important;
  padding: 0 !important;
  overflow: hidden !important;
  background: white !important;
}
#calcontent #nav table.DP_monthtable {
  width: 160px !important;
  margin: 7px auto !important;
}
#calcontent #nav table.DP_monthtable td {
  padding: 1px !important;
  border: none !important;
}
#calcontent #nav table.DP_monthtable tr.DP_heading td {
  padding: 2px !important;
  background: #BFDBFF !important;
  font-weight: normal !important;
  text-transform: lowercase !important;
  color: black !important;
}
#calcontent #nav table.DP_monthtable tr.DP_days td {
  border-bottom: solid 1px #9AC6FF !important;
}
#calcontent #nav table.DP_monthtable tr td.DP_today,
#calcontent #nav table.DP_monthtable tr td.DP_today_selected {
  padding: 0 !important;
  border: solid 1px #BB5503 !important;
  background: white !important;
  color: black !important;
}
#calcontent #nav table.DP_monthtable tr td.DP_weekend {
  background: white !important;
}
#calcontent #nav table.DP_monthtable tr td.DP_weekday_selected,
#calcontent #nav table.DP_monthtable tr td.DP_weekend_selected {
  background: #FBC84F !important;
  color: black !important;
}

/***********************************************/

#calcontent #mainnav td[style*="float: right"] table td[onmousedown*="list"] {
  position: fixed !important;
  top: 60px !important;
  top: 239px !important;
  left: 4px !important;
  width: 187px !important;
  height: 21px !important;
  padding: 2px !important;
  overflow: hidden !important;
  background: white !important;
  color: #15428B !important;
  text-align: left !important;
}
#calcontent #mainnav td[style*="float: right"] table td[onmousedown*="list"] div {
  width: 181px !important;
  padding: 3px !important;
  overflow: hidden !important;
  border: none !important;
  background: white !important;
  font-weight: bold !important;
  text-align: left !important;
}
#calcontent #mainnav td[style*="float: right"] table td[onmousedown*="list"] div:hover {
  border: solid 1px #6593CF !important;
  padding: 2px !important;
  background: repeat-x url("data:image/png;base64,") !important;
}
#calcontent #mainnav td[style*="float: right"] table td[onmousedown*="list"] div:active {
  border: solid 1px #6593CF !important;
  padding: 2px !important;
  background-position: bottom !important;
}

/***********************************************/

#calcontent #nav table.sidebar {
  display: table !important;
  display: none !important;

  position: fixed !important;
  top: 61px !important;
  left: 4px !important;
  width: 192px !important;
  height: 25px !important;
  table-layout: fixed !important;
  border-collapse: collapse !important;
  border: solid 1px #6593CF !important;
  background: #E3EFFF !important;
}
#calcontent #nav table.sidebar tbody { display: table-row !important; }
#calcontent #nav table.sidebar tr { display: table-cell !important; }
#calcontent #nav table.sidebar td {
  display: block !important;
  padding: 0 !important;
  text-align: center !important;
}
#calcontent #nav table.sidebar tr:not(:first-child) td {
  border-left: solid 1px #6593CF !important;
}
#calcontent #nav table.sidebar td {
  display: block !important;
  padding: 0 !important;
  text-align: center !important;
}
#calcontent #nav table.sidebar span {
  display: block !important;
  /*padding: 5px 2px !important;*/
  text-decoration: none !important;
  color: black !important;
}
#calcontent #nav table.sidebar span b {
  font-weight: normal !important;
}

/***********************************************/

}
